const ListItem = ({movie, request}) => {
    const poster = request + movie.poster_path;
    return (
        <div>
            <h2>{movie.title}</h2>
            <h3>Popularity: {movie.popularity}</h3>
            <h4>{movie.release_date}</h4>
            <p>{movie.overview}</p>
            <img src={poster} id="moviePoster"></img>
        </div>
    )
}
export default ListItem
